import styled from "styled-components";

export const MainContainer = styled.div `
display: flex;
background-color: #1B6090;
flex-direction: column;
width: 100vw;
height: 100vh;
`

export const TitleContainer = styled.div `
display: flex;
flex-direction: column;
`

export const CardContainer = styled.div `
display: flex;
flex-direction: column;
background-color: #1B6090;
`
